contracts/CitizenRegistry.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

/**
 * @title CitizenRegistry
 * @dev Smart contract for managing citizen registration and verification
 */
contract CitizenRegistry is Ownable, ReentrancyGuard {
    
    struct Citizen {
        string aadharHash;      // Hashed Aadhar number for privacy
        string name;            // Full name
        string email;           // Email address
        string phone;           // Phone number
        bool isVerified;        // Verification status
        uint256 registrationDate;
        address walletAddress;  // Ethereum wallet address
    }
    
    // Mappings
    mapping(address => Citizen) public citizens;
    mapping(string => address) private aadharToAddress;
    mapping(address => bool) public verifiers;
    
    // Arrays for enumeration
    address[] public citizenAddresses;
    
    // Events
    event CitizenRegistered(address indexed citizenAddress, string name, uint256 timestamp);
    event CitizenVerified(address indexed citizenAddress, address indexed verifier, uint256 timestamp);
    event VerifierAdded(address indexed verifier, uint256 timestamp);
    event VerifierRemoved(address indexed verifier, uint256 timestamp);
    
    // Modifiers
    modifier onlyVerifier() {
        require(verifiers[msg.sender] || msg.sender == owner(), "Not authorized verifier");
        _;
    }
    
    modifier citizenExists(address _citizen) {
        require(bytes(citizens[_citizen].aadharHash).length > 0, "Citizen not registered");
        _;
    }
    
    constructor() Ownable(msg.sender) {
        verifiers[msg.sender] = true; // Owner is default verifier
    }
    
    /**
     * @dev Register a new citizen
     * @param _aadharHash Hashed Aadhar number
     * @param _name Full name
     * @param _email Email address  
     * @param _phone Phone number
     */
    function registerCitizen(
        string memory _aadharHash,
        string memory _name,
        string memory _email,
        string memory _phone
    ) external nonReentrant {
        require(bytes(_aadharHash).length > 0, "Aadhar hash required");
        require(bytes(_name).length > 0, "Name required");
        require(bytes(citizens[msg.sender].aadharHash).length == 0, "Citizen already registered");
        require(aadharToAddress[_aadharHash] == address(0), "Aadhar already registered");
        
        citizens[msg.sender] = Citizen({
            aadharHash: _aadharHash,
            name: _name,
            email: _email,
            phone: _phone,
            isVerified: false,
            registrationDate: block.timestamp,
            walletAddress: msg.sender
        });
        
        aadharToAddress[_aadharHash] = msg.sender;
        citizenAddresses.push(msg.sender);
        
        emit CitizenRegistered(msg.sender, _name, block.timestamp);
    }
    
    /**
     * @dev Verify a citizen (only verifiers)
     * @param _citizenAddress Address of citizen to verify
     */
    function verifyCitizen(address _citizenAddress) 
        external 
        onlyVerifier 
        citizenExists(_citizenAddress) 
    {
        require(!citizens[_citizenAddress].isVerified, "Citizen already verified");
        
        citizens[_citizenAddress].isVerified = true;
        
        emit CitizenVerified(_citizenAddress, msg.sender, block.timestamp);
    }
    
    /**
     * @dev Add a new verifier (only owner)
     * @param _verifier Address to add as verifier
     */
    function addVerifier(address _verifier) external onlyOwner {
        require(_verifier != address(0), "Invalid address");
        require(!verifiers[_verifier], "Already a verifier");
        
        verifiers[_verifier] = true;
        emit VerifierAdded(_verifier, block.timestamp);
    }
    
    /**
     * @dev Remove a verifier (only owner)
     * @param _verifier Address to remove as verifier
     */
    function removeVerifier(address _verifier) external onlyOwner {
        require(verifiers[_verifier], "Not a verifier");
        require(_verifier != owner(), "Cannot remove owner");
        
        verifiers[_verifier] = false;
        emit VerifierRemoved(_verifier, block.timestamp);
    }
    
    /**
     * @dev Get citizen details
     * @param _citizenAddress Address of citizen
     * @return Citizen struct
     */
    function getCitizen(address _citizenAddress) 
        external 
        view 
        citizenExists(_citizenAddress)
        returns (Citizen memory) 
    {
        return citizens[_citizenAddress];
    }
    
    /**
     * @dev Check if citizen is registered
     * @param _citizenAddress Address to check
     * @return bool registration status
     */
    function isCitizenRegistered(address _citizenAddress) external view returns (bool) {
        return bytes(citizens[_citizenAddress].aadharHash).length > 0;
    }
    
    /**
     * @dev Get total number of registered citizens
     * @return uint256 total count
     */
    function getTotalCitizens() external view returns (uint256) {
        return citizenAddresses.length;
    }
    
    /**
     * @dev Get citizen address by Aadhar hash
     * @param _aadharHash Hashed Aadhar number
     * @return address of citizen
     */
    function getCitizenByAadhar(string memory _aadharHash) external view returns (address) {
        return aadharToAddress[_aadharHash];
    }
    
    /**
     * @dev Update citizen profile (only by citizen)
     * @param _name New name
     * @param _email New email
     * @param _phone New phone
     */
    function updateProfile(
        string memory _name,
        string memory _email,
        string memory _phone
    ) external citizenExists(msg.sender) {
        require(bytes(_name).length > 0, "Name required");
        
        Citizen storage citizen = citizens[msg.sender];
        citizen.name = _name;
        citizen.email = _email;
        citizen.phone = _phone;
    }
}

contracts/DocumentRegistry.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

/**
 * @title DocumentRegistry
 * @dev Smart contract for managing document storage and verification
 */
contract DocumentRegistry is Ownable, ReentrancyGuard {
    
    enum DocumentType {
        AADHAR,
        PAN,
        DRIVING_LICENSE,
        PASSPORT,
        VOTER_ID,
        BIRTH_CERTIFICATE,
        OTHER
    }
    
    enum DocumentStatus {
        PENDING,
        VERIFIED,
        REJECTED,
        EXPIRED
    }
    
    struct Document {
        uint256 id;
        address owner;
        string documentHash;    // IPFS hash
        DocumentType docType;
        DocumentStatus status;
        string metadata;        // JSON metadata
        uint256 uploadDate;
        uint256 verificationDate;
        address verifier;
        string rejectionReason;
        uint256 expiryDate;
    }
    
    // Mappings
    mapping(uint256 => Document) public documents;
    mapping(address => uint256[]) public userDocuments;
    mapping(address => bool) public verifiers;
    mapping(string => bool) private documentHashes;
    
    // State variables
    uint256 private nextDocumentId = 1;
    uint256 public totalDocuments;
    
    // Events
    event DocumentUploaded(
        uint256 indexed documentId, 
        address indexed owner, 
        DocumentType docType, 
        string documentHash,
        uint256 timestamp
    );
    
    event DocumentVerified(
        uint256 indexed documentId, 
        address indexed verifier, 
        uint256 timestamp
    );
    
    event DocumentRejected(
        uint256 indexed documentId, 
        address indexed verifier, 
        string reason,
        uint256 timestamp
    );
    
    event VerifierAdded(address indexed verifier, uint256 timestamp);
    event VerifierRemoved(address indexed verifier, uint256 timestamp);
    
    // Modifiers
    modifier onlyVerifier() {
        require(verifiers[msg.sender] || msg.sender == owner(), "Not authorized verifier");
        _;
    }
    
    modifier onlyDocumentOwner(uint256 _documentId) {
        require(documents[_documentId].owner == msg.sender, "Not document owner");
        _;
    }
    
    modifier documentExists(uint256 _documentId) {
        require(documents[_documentId].id != 0, "Document does not exist");
        _;
    }
    
    constructor() Ownable(msg.sender) {
        verifiers[msg.sender] = true; // Owner is default verifier
    }
    
    /**
     * @dev Upload a new document
     * @param _documentHash IPFS hash of the document
     * @param _docType Type of document
     * @param _metadata JSON metadata about the document
     * @param _expiryDate Expiry date (0 for no expiry)
     */
    function uploadDocument(
        string memory _documentHash,
        DocumentType _docType,
        string memory _metadata,
        uint256 _expiryDate
    ) external nonReentrant returns (uint256) {
        require(bytes(_documentHash).length > 0, "Document hash required");
        require(!documentHashes[_documentHash], "Document already exists");
        require(_expiryDate == 0 || _expiryDate > block.timestamp, "Invalid expiry date");
        
        uint256 documentId = nextDocumentId++;
        
        documents[documentId] = Document({
            id: documentId,
            owner: msg.sender,
            documentHash: _documentHash,
            docType: _docType,
            status: DocumentStatus.PENDING,
            metadata: _metadata,
            uploadDate: block.timestamp,
            verificationDate: 0,
            verifier: address(0),
            rejectionReason: "",
            expiryDate: _expiryDate
        });
        
        userDocuments[msg.sender].push(documentId);
        documentHashes[_documentHash] = true;
        totalDocuments++;
        
        emit DocumentUploaded(documentId, msg.sender, _docType, _documentHash, block.timestamp);
        
        return documentId;
    }
    
    /**
     * @dev Verify a document (only verifiers)
     * @param _documentId ID of document to verify
     */
    function verifyDocument(uint256 _documentId) 
        external 
        onlyVerifier 
        documentExists(_documentId) 
    {
        Document storage doc = documents[_documentId];
        require(doc.status == DocumentStatus.PENDING, "Document not pending verification");
        require(doc.expiryDate == 0 || doc.expiryDate > block.timestamp, "Document expired");
        
        doc.status = DocumentStatus.VERIFIED;
        doc.verificationDate = block.timestamp;
        doc.verifier = msg.sender;
        
        emit DocumentVerified(_documentId, msg.sender, block.timestamp);
    }
    
    /**
     * @dev Reject a document (only verifiers)
     * @param _documentId ID of document to reject
     * @param _reason Reason for rejection
     */
    function rejectDocument(uint256 _documentId, string memory _reason) 
        external 
        onlyVerifier 
        documentExists(_documentId) 
    {
        require(bytes(_reason).length > 0, "Rejection reason required");
        
        Document storage doc = documents[_documentId];
        require(doc.status == DocumentStatus.PENDING, "Document not pending verification");
        
        doc.status = DocumentStatus.REJECTED;
        doc.verificationDate = block.timestamp;
        doc.verifier = msg.sender;
        doc.rejectionReason = _reason;
        
        emit DocumentRejected(_documentId, msg.sender, _reason, block.timestamp);
    }
    
    /**
     * @dev Add a new verifier (only owner)
     * @param _verifier Address to add as verifier
     */
    function addVerifier(address _verifier) external onlyOwner {
        require(_verifier != address(0), "Invalid address");
        require(!verifiers[_verifier], "Already a verifier");
        
        verifiers[_verifier] = true;
        emit VerifierAdded(_verifier, block.timestamp);
    }
    
    /**
     * @dev Remove a verifier (only owner)
     * @param _verifier Address to remove as verifier
     */
    function removeVerifier(address _verifier) external onlyOwner {
        require(verifiers[_verifier], "Not a verifier");
        require(_verifier != owner(), "Cannot remove owner");
        
        verifiers[_verifier] = false;
        emit VerifierRemoved(_verifier, block.timestamp);
    }
    
    /**
     * @dev Get document details
     * @param _documentId ID of document
     * @return Document struct
     */
    function getDocument(uint256 _documentId) 
        external 
        view 
        documentExists(_documentId)
        returns (Document memory) 
    {
        return documents[_documentId];
    }
    
    /**
     * @dev Get user's documents
     * @param _user Address of user
     * @return Array of document IDs
     */
    function getUserDocuments(address _user) external view returns (uint256[] memory) {
        return userDocuments[_user];
    }
    
    /**
     * @dev Get documents by status
     * @param _status Document status to filter by
     * @return Array of document IDs
     */
    function getDocumentsByStatus(DocumentStatus _status) 
        external 
        view 
        returns (uint256[] memory) 
    {
        uint256[] memory result = new uint256[](totalDocuments);
        uint256 count = 0;
        
        for (uint256 i = 1; i < nextDocumentId; i++) {
            if (documents[i].status == _status) {
                result[count] = i;
                count++;
            }
        }
        
        // Resize array
        uint256[] memory filteredResult = new uint256[](count);
        for (uint256 i = 0; i < count; i++) {
            filteredResult[i] = result[i];
        }
        
        return filteredResult;
    }
    
    /**
     * @dev Check if document is verified
     * @param _documentId ID of document
     * @return bool verification status
     */
    function isDocumentVerified(uint256 _documentId) 
        external 
        view 
        documentExists(_documentId)
        returns (bool) 
    {
        return documents[_documentId].status == DocumentStatus.VERIFIED;
    }
    
    /**
     * @dev Mark expired documents
     * @param _documentIds Array of document IDs to check
     */
    function markExpiredDocuments(uint256[] memory _documentIds) external {
        for (uint256 i = 0; i < _documentIds.length; i++) {
            uint256 docId = _documentIds[i];
            Document storage doc = documents[docId];
            
            if (doc.id != 0 && 
                doc.expiryDate != 0 && 
                doc.expiryDate <= block.timestamp && 
                doc.status == DocumentStatus.VERIFIED) {
                doc.status = DocumentStatus.EXPIRED;
            }
        }
    }
}

contracts/GrievanceSystem.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

/**
 * @title GrievanceSystem
 * @dev Smart contract for managing public grievances and complaints
 */
contract GrievanceSystem is Ownable, ReentrancyGuard {
    
    enum Priority {
        LOW,
        MEDIUM,
        HIGH,
        URGENT
    }
    
    enum Status {
        SUBMITTED,
        IN_PROGRESS,
        RESOLVED,
        CLOSED,
        ESCALATED
    }
    
    enum Category {
        INFRASTRUCTURE,
        WATER_SUPPLY,
        ELECTRICITY,
        SANITATION,
        ROADS,
        HEALTHCARE,
        EDUCATION,
        CORRUPTION,
        OTHER
    }
    
    struct Grievance {
        uint256 id;
        address citizen;
        string title;
        string description;
        Category category;
        Priority priority;
        Status status;
        uint256 submitDate;
        uint256 resolvedDate;
        address assignedOfficer;
        string resolution;
        uint256 satisfactionRating; // 1-5 scale
        string[] comments;
        string location;
        string[] attachments; // IPFS hashes
    }
    
    struct Comment {
        address author;
        string content;
        uint256 timestamp;
        bool isOfficial;
    }
    
    // Mappings
    mapping(uint256 => Grievance) public grievances;
    mapping(uint256 => Comment[]) public grievanceComments;
    mapping(address => uint256[]) public citizenGrievances;
    mapping(address => uint256[]) public officerGrievances;
    mapping(address => bool) public officers;
    mapping(Category => address) public categoryOfficers;
    
    // State variables
    uint256 private nextGrievanceId = 1;
    uint256 public totalGrievances;
    
    // Events
    event GrievanceSubmitted(
        uint256 indexed grievanceId,
        address indexed citizen,
        Category category,
        Priority priority,
        uint256 timestamp
    );
    
    event GrievanceAssigned(
        uint256 indexed grievanceId,
        address indexed officer,
        uint256 timestamp
    );
    
    event GrievanceStatusUpdated(
        uint256 indexed grievanceId,
        Status oldStatus,
        Status newStatus,
        uint256 timestamp
    );
    
    event GrievanceResolved(
        uint256 indexed grievanceId,
        address indexed officer,
        string resolution,
        uint256 timestamp
    );
    
    event CommentAdded(
        uint256 indexed grievanceId,
        address indexed author,
        string content,
        bool isOfficial,
        uint256 timestamp
    );
    
    event OfficerAdded(address indexed officer, uint256 timestamp);
    event OfficerRemoved(address indexed officer, uint256 timestamp);
    
    // Modifiers
    modifier onlyOfficer() {
        require(officers[msg.sender] || msg.sender == owner(), "Not authorized officer");
        _;
    }
    
    modifier onlyGrievanceParticipant(uint256 _grievanceId) {
        Grievance memory grievance = grievances[_grievanceId];
        require(
            msg.sender == grievance.citizen || 
            msg.sender == grievance.assignedOfficer || 
            officers[msg.sender] || 
            msg.sender == owner(),
            "Not authorized to access this grievance"
        );
        _;
    }
    
    modifier grievanceExists(uint256 _grievanceId) {
        require(grievances[_grievanceId].id != 0, "Grievance does not exist");
        _;
    }
    
    constructor() Ownable(msg.sender) {
        officers[msg.sender] = true; // Owner is default officer
    }
    
    /**
     * @dev Submit a new grievance
     * @param _title Title of the grievance
     * @param _description Detailed description
     * @param _category Category of the grievance
     * @param _priority Priority level
     * @param _location Location of the issue
     * @param _attachments Array of IPFS hashes for attachments
     */
    function submitGrievance(
        string memory _title,
        string memory _description,
        Category _category,
        Priority _priority,
        string memory _location,
        string[] memory _attachments
    ) external nonReentrant returns (uint256) {
        require(bytes(_title).length > 0, "Title required");
        require(bytes(_description).length > 0, "Description required");
        
        uint256 grievanceId = nextGrievanceId++;
        
        grievances[grievanceId] = Grievance({
            id: grievanceId,
            citizen: msg.sender,
            title: _title,
            description: _description,
            category: _category,
            priority: _priority,
            status: Status.SUBMITTED,
            submitDate: block.timestamp,
            resolvedDate: 0,
            assignedOfficer: address(0),
            resolution: "",
            satisfactionRating: 0,
            comments: new string[](0),
            location: _location,
            attachments: _attachments
        });
        
        citizenGrievances[msg.sender].push(grievanceId);
        totalGrievances++;
        
        // Auto-assign to category officer if available
        address categoryOfficer = categoryOfficers[_category];
        if (categoryOfficer != address(0)) {
            _assignGrievance(grievanceId, categoryOfficer);
        }
        
        emit GrievanceSubmitted(grievanceId, msg.sender, _category, _priority, block.timestamp);
        
        return grievanceId;
    }
    
    /**
     * @dev Assign grievance to an officer
     * @param _grievanceId ID of the grievance
     * @param _officer Address of the officer
     */
    function assignGrievance(uint256 _grievanceId, address _officer) 
        external 
        onlyOfficer 
        grievanceExists(_grievanceId) 
    {
        require(officers[_officer], "Invalid officer");
        _assignGrievance(_grievanceId, _officer);
    }
    
    /**
     * @dev Internal function to assign grievance
     */
    function _assignGrievance(uint256 _grievanceId, address _officer) internal {
        Grievance storage grievance = grievances[_grievanceId];
        require(grievance.status == Status.SUBMITTED, "Grievance already assigned");
        
        grievance.assignedOfficer = _officer;
        grievance.status = Status.IN_PROGRESS;
        
        officerGrievances[_officer].push(_grievanceId);
        
        emit GrievanceAssigned(_grievanceId, _officer, block.timestamp);
        emit GrievanceStatusUpdated(_grievanceId, Status.SUBMITTED, Status.IN_PROGRESS, block.timestamp);
    }
    
    /**
     * @dev Update grievance status
     * @param _grievanceId ID of the grievance
     * @param _newStatus New status
     */
    function updateGrievanceStatus(uint256 _grievanceId, Status _newStatus) 
        external 
        onlyOfficer 
        grievanceExists(_grievanceId) 
    {
        Grievance storage grievance = grievances[_grievanceId];
        Status oldStatus = grievance.status;
        require(oldStatus != _newStatus, "Status already set");
        
        grievance.status = _newStatus;
        
        emit GrievanceStatusUpdated(_grievanceId, oldStatus, _newStatus, block.timestamp);
    }
    
    /**
     * @dev Resolve a grievance
     * @param _grievanceId ID of the grievance
     * @param _resolution Resolution description
     */
    function resolveGrievance(uint256 _grievanceId, string memory _resolution) 
        external 
        onlyOfficer 
        grievanceExists(_grievanceId) 
    {
        require(bytes(_resolution).length > 0, "Resolution required");
        
        Grievance storage grievance = grievances[_grievanceId];
        require(grievance.status == Status.IN_PROGRESS, "Grievance not in progress");
        
        grievance.status = Status.RESOLVED;
        grievance.resolution = _resolution;
        grievance.resolvedDate = block.timestamp;
        
        emit GrievanceResolved(_grievanceId, msg.sender, _resolution, block.timestamp);
        emit GrievanceStatusUpdated(_grievanceId, Status.IN_PROGRESS, Status.RESOLVED, block.timestamp);
    }
    
    /**
     * @dev Add comment to grievance
     * @param _grievanceId ID of the grievance
     * @param _content Comment content
     */
    function addComment(uint256 _grievanceId, string memory _content) 
        external 
        grievanceExists(_grievanceId)
        onlyGrievanceParticipant(_grievanceId)
    {
        require(bytes(_content).length > 0, "Comment content required");
        
        bool isOfficial = officers[msg.sender];
        
        grievanceComments[_grievanceId].push(Comment({
            author: msg.sender,
            content: _content,
            timestamp: block.timestamp,
            isOfficial: isOfficial
        }));
        
        emit CommentAdded(_grievanceId, msg.sender, _content, isOfficial, block.timestamp);
    }
    
    /**
     * @dev Rate resolution satisfaction (only citizen)
     * @param _grievanceId ID of the grievance
     * @param _rating Rating from 1-5
     */
    function rateSatisfaction(uint256 _grievanceId, uint256 _rating) 
        external 
        grievanceExists(_grievanceId) 
    {
        require(_rating >= 1 && _rating <= 5, "Rating must be 1-5");
        
        Grievance storage grievance = grievances[_grievanceId];
        require(msg.sender == grievance.citizen, "Only citizen can rate");
        require(grievance.status == Status.RESOLVED, "Grievance not resolved");
        require(grievance.satisfactionRating == 0, "Already rated");
        
        grievance.satisfactionRating = _rating;
    }
    
    /**
     * @dev Add officer
     * @param _officer Address to add as officer
     */
    function addOfficer(address _officer) external onlyOwner {
        require(_officer != address(0), "Invalid address");
        require(!officers[_officer], "Already an officer");
        
        officers[_officer] = true;
        emit OfficerAdded(_officer, block.timestamp);
    }
    
    /**
     * @dev Remove officer
     * @param _officer Address to remove as officer
     */
    function removeOfficer(address _officer) external onlyOwner {
        require(officers[_officer], "Not an officer");
        require(_officer != owner(), "Cannot remove owner");
        
        officers[_officer] = false;
        emit OfficerRemoved(_officer, block.timestamp);
    }
    
    /**
     * @dev Set category officer
     * @param _category Category to assign
     * @param _officer Officer address
     */
    function setCategoryOfficer(Category _category, address _officer) external onlyOwner {
        require(officers[_officer], "Invalid officer");
        categoryOfficers[_category] = _officer;
    }
    
    /**
     * @dev Get grievance details
     * @param _grievanceId ID of grievance
     * @return Grievance struct
     */
    function getGrievance(uint256 _grievanceId) 
        external 
        view 
        grievanceExists(_grievanceId)
        onlyGrievanceParticipant(_grievanceId)
        returns (Grievance memory) 
    {
        return grievances[_grievanceId];
    }
    
    /**
     * @dev Get grievance comments
     * @param _grievanceId ID of grievance
     * @return Array of comments
     */
    function getGrievanceComments(uint256 _grievanceId) 
        external 
        view 
        grievanceExists(_grievanceId)
        onlyGrievanceParticipant(_grievanceId)
        returns (Comment[] memory) 
    {
        return grievanceComments[_grievanceId];
    }
    
    /**
     * @dev Get citizen's grievances
     * @param _citizen Address of citizen
     * @return Array of grievance IDs
     */
    function getCitizenGrievances(address _citizen) external view returns (uint256[] memory) {
        return citizenGrievances[_citizen];
    }
    
    /**
     * @dev Get officer's assigned grievances
     * @param _officer Address of officer
     * @return Array of grievance IDs
     */
    function getOfficerGrievances(address _officer) external view returns (uint256[] memory) {
        return officerGrievances[_officer];
    }
    
    /**
     * @dev Get grievances by status
     * @param _status Status to filter by
     * @return Array of grievance IDs
     */
    function getGrievancesByStatus(Status _status) external view returns (uint256[] memory) {
        uint256[] memory result = new uint256[](totalGrievances);
        uint256 count = 0;
        
        for (uint256 i = 1; i < nextGrievanceId; i++) {
            if (grievances[i].status == _status) {
                result[count] = i;
                count++;
            }
        }
        
        // Resize array
        uint256[] memory filteredResult = new uint256[](count);
        for (uint256 i = 0; i < count; i++) {
            filteredResult[i] = result[i];
        }
        
        return filteredResult;
    }
}

